import React from "react";

function Filter() {
  let pupil = [
    { name: "macmuka" },
    { name: "eric" },
    { name: "josh" },
    { name: "tonny" },
  ];
  function itemClicked(e) {
    let m = e.target.getAttribute("attrib");
    pupil.filter((ckid) => {
      return !ckid.m;
    });
  }
  return (
    <div>
      {pupil.map((kid) => {
        return (
          <div>
            <p>
              {kid.name}
              <button attrib={kid.name} onClick={itemClicked}>
                X
              </button>
            </p>
          </div>
        );
      })}
    </div>
  );
}

export default Filter;
